import './App.css';
import Register from './component/UserMgmt/Registeration';
import {useState} from 'react'
import SignIn from './component/UserMgmt/SignIn';
import LandingPage from './component/Product/LandingPage';
import MasterLanding from './component/Common/MasterLanding';

function App() {
  const [State,setState] = useState("LandingPage");

  const ChangeState =(parameter) =>
  {
    setState(parameter);
  }

  return (
    <div>
      if{ State == "LandingPage" &&
        <LandingPage IsLandingPage = {ChangeState} />

      }
      if{State == "MasterLanding" && 
        <MasterLanding IsMasterPage = {ChangeState} />
      }

    </div>

  );
}
export default App;
